import { createTheme, ThemeProvider } from '@mui/material/styles';
import { useEffect } from 'react';
import Home from './pages/Home';
import CssBaseline from '@mui/material/CssBaseline';
import { Route, Routes } from '@mui/icons-material';


const theme = createTheme({
  palette: {
    primary: {
      light: '#4f5b62',
      main: '#263238',
      dark: '#000a12',
      contrastText: '#fff',
    },
    secondary: {
      light: '#ffffff',
      main: '#efebe9',
      dark: '#bdb9b7',
      contrastText: '#000',
    },
  },
});

function App() {

  useEffect (() => {
    document.body.style.backgroundColor = '#efebe9';
  })
  return (
  <>
   <CssBaseline />
      <ThemeProvider theme={theme}>
        <Routes>
          <Route path='/' element={<Home/>} />
          <Route path='/' element={<CreateRoutine/>} />
        </Routes>
      </ThemeProvider>
  </>
  )
}


export default App;
